import axios from 'axios'
import { HOLD_EDIT_USER } from './types';

export const holdTempUser = (user) => {
    return {
        type: HOLD_EDIT_USER,
        payload: user
    }
}

export const holdTempUserType = (type) => {
    return {
        type: HOLD_EDIT_USER_TYPE
    }
}
